const ProductTemp= ({ image, name,  price }:{ image:any, name:any,  price:any }) => {
    return (
      <div className="row product">
        <div className="col-mx-1">
          <img src={image} alt={name} height="150" />
        </div>
        <div className="col-mx-2 product-detail">
          <h4>{name}</h4>
        </div>
        <div className="col-mx-1 product-price">
          {price}
        </div>
      </div>
    );
  }
  export default ProductTemp;
